spring:
  profiles:
    active: prod
  datasource:
    platform: postgres
    url: '{cipher}'
    username: '{cipher}'
    password: '{cipher}'
    hikari:
      connection-timeout: 30000
      maximum-pool-size: 10
  jpa:
    database-platform: org.hibernate.dialect.PostgreSQL95Dialect

eureka:
  client:
    serviceUrl:
      defaultZone: '{cipher}'
  instance:
    instance-id: ${spring.application.name}:${spring.cloud.client.ip-address}:${server.port}
